text49771.addInnerText('<div id=\"text49771\" aria-hidden=\"true\" ><a id=\"text49771anc\" style=\"display:block;height:0px;width:0px;\"></a>\n<p  legLH=\"1.336\" style=\"margin-left:0px;text-indent:0px;line-height:1.250;margin-top:0px;margin-bottom:0px;text-align:justify;\" >\n<span class=\"text49771Font1\"  >&nbsp;&nbsp;&nbsp;&nbsp;Turbin angin tidak mengeluarkan gas rumah kaca atau polutan saat menghasilkan listrik. Turbin angin tidak melepaskan emisi yang dapat mencemari udara atau air (dengan pengecualian yang jarang terjadi), dan tidak membutuhkan air untuk pendinginan. Angin berperan sebagai alat bantu proses terjadinya hujan dan dapat digunakan secara cuma-cuma karena berasal dari alam dan tidak pernah habis. \n</span ></p >\n</div>\n');
text49771.build()

text120517.addInnerText('<div id=\"text120517\" aria-hidden=\"true\" ><a id=\"text120517anc\" style=\"display:block;height:0px;width:0px;\"></a>\n<p  legLH=\"1.336\" style=\"margin-left:0px;text-indent:0px;line-height:1.250;margin-top:0px;margin-bottom:7px;text-align:justify;\" >\n<span class=\"text120517Font2\"  >Kelebihan Energi Air</span ><span class=\"text120517Font3\" style=\"background-color:transparent\" >\n</span ></p >\n<ol  start=\"1\" style=\"list-style-position:outside;text-align:justify;\" >\n<li  class=\"text120517Font4\" style=\"line-height:1.336;position:relative;padding-left:10px;list-style-type:decimal;margin-left:13px;margin-top:0px;margin-bottom:0px;\"><span class=\"text120517Font4\"  >Salah satu sumber energi terbarukan dan.\n</span ></li >\n<li  class=\"text120517Font4\" style=\"line-height:1.336;position:relative;padding-left:10px;list-style-type:decimal;margin-left:13px;margin-top:0px;margin-bottom:0px;\"><span class=\"text120517Font4\"  >Tidak menghasilkan polusi udara maupun gas rumah kaca.\n</span ></li >\n<li  class=\"text120517Font4\" style=\"line-height:1.336;position:relative;padding-left:10px;list-style-type:decimal;margin-left:13px;margin-top:0px;margin-bottom:0px;\"><span class=\"text120517Font4\"  >Biaya operasi rendah.\n</span ></li >\n<li  class=\"text120517Font4\" style=\"line-height:1.336;position:relative;padding-left:10px;list-style-type:decimal;margin-left:13px;margin-top:0px;margin-bottom:0px;\"><span class=\"text120517Font4\"  >Penggunaan lahan secara efisien bisa bersamaan dengan lahan untuk pertanian.\n</span ></li >\n</ol >\n</div>\n');
